        count: Optional[Union[bool, 'types.AssessmentResultCountAggregateInput']] = None,
        order: Optional[Union[Mapping['types.AssessmentResultScalarFieldKeys', 'types.SortOrder'], List[Mapping['types.AssessmentResultScalarFieldKeys', 'types.SortOrder']]]] = None,
